name: ''
path: ''
root_name: ''
nodes: 
  - 
    module: "ros_bt_py.nodes.sequence"
    node_class: "Sequence"
    version: ''
    max_children: -1
    name: "Sequence"
    child_names: [Subtree]
    options: []
    inputs: []
    outputs: []
    option_wirings: []
    state: "UNINITIALIZED"
  - 
    module: "ros_bt_py.nodes.subtree"
    node_class: "Subtree"
    version: ''
    max_children: 0
    name: "Subtree"
    child_names: []
    options: 
      - 
        key: "subtree_path"
        serialized_value: "\"foo\""
        serialized_type: "{\"py/type\": \"__builtin__.basestring\"}"
