        key: "use_io_nodes"
        serialized_value: "true"
        serialized_type: "{\"py/type\": \"__builtin__.bool\"}"
    inputs: []
    outputs: 
      - 
        key: "load_success"
        serialized_value: "false"
        serialized_type: "{\"py/type\": \"__builtin__.bool\"}"
