        serialized_type: "{\"py/type\": \"__builtin__.basestring\"}"
    option_wirings: []
    state: "UNINITIALIZED"
data_wirings: []
tick_frequency_hz: 10.0
state: "EDITABLE"
public_node_data: 
  - 
    node_name: "Subtree"
    data_kind: "outputs"
